import React, { Fragment } from 'react';
import List from './List';
import Header from './Header';

class App extends React.Component {
    render() {
        return (
            <Fragment>
                <Header />
                <div id='content'>
                    <List />
                </div>
            </Fragment>
        )
    }
}

export default App;
